var userImage = ['https://i.imgur.com/VDxIE08.gif','https://i.imgur.com/mYZvWZr.gif','https://i.imgur.com/9LQUAOI.gif','https://i.imgur.com/1zLVJ2X.gif','https://i.imgur.com/1h954hk.gif'];

function randNum(min, max) {
	return Math.floor(Math.random() * (max - min) + min);
}

var firebnb = [];

function createProperty() {
var property = {
	_id: _id + 1,
	accuracy: 0,
	communication: 0,
	cleanliness: 0,
	location: 0,
	checkin: 0,
	value: 0,
 	reviews: [],
 	totalReviews: {
    average: 0,
    total: 0
 	}
}

for (var i = 0; i < randNum(4, 9); i++) {
var review =  {
  accuracy: randNum(3, 6),
  communication: randNum(3, 6),
  cleanliness: randNum(3, 6),
  location: randNum(3, 6),
  checkin: randNum(3, 6),
  value: randNum(3, 6),
  username: username[randNum(0, 1000)],
  date: month[randNum(0, 12)] + " " + year[randNum(0, 4)],
  comment: comments[randNum(0, 1000)],
  userImage: userImage[randNum(0, 5)],
  propertyId: _id + 1
}
	property.reviews.push(review)
}

_id++;

for (var j = 0; j < property.reviews.length; j++) {
	property.accuracy += property.reviews[j].accuracy
	property.communication += property.reviews[j].communication
	property.cleanliness += property.reviews[j].cleanliness
	property.location += property.reviews[j].location
	property.checkin += property.reviews[j].checkin
	property.value += property.reviews[j].value
}

  property.accuracy = Math.ceil(property.accuracy / property.reviews.length * 2) / 2;
  property.communication = Math.ceil(property.communication / property.reviews.length * 2) / 2;
  property.cleanliness = Math.ceil(property.cleanliness / property.reviews.length * 2) / 2;
  property.location = Math.ceil(property.location / property.reviews.length * 2) / 2;
  property.checkin = Math.ceil(property.checkin / property.reviews.length * 2) / 2;
  property.value = Math.ceil(property.value / property.reviews.length * 2) / 2;

  property.totalReviews.total = property.reviews.length;
  property.totalReviews.average = Math.round(
  																(property.accuracy +
  																property.communication +
  																property.cleanliness +
  																property.location +
  																property.checkin +
  																property.value) / 6 * 2) / 2;

	firebnb.push(JSON.stringify(property));
} 


function make(num) {
	for (var i = 0; i < num; i++) {
		createProperty();
	}
}
make(500000);

var fileName = 'file' + fileCount + '.js'

	fs.writeFile(fileName, '[', (err) => {
		if(err) {
			console.error(err);
			return;
		}
		console.log('file start')
	})

	fs.appendFile(fileName, firebnb, (err) => {
		if(err) {
			console.error(err);
			return;
		}
		console.log('json added')
	})

	fs.appendFile(fileName, ']', function (err) {
	  if (err) throw err;
	  console.log('file done');
	  fileCount++
	});

